  return (
    <Slider>
        <div className="testimonial py-4 px-3">
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Est ullam eligendi officiis suscipit eveniet delectus enim quas deserunt impedit quis, eius tenetur repellendus dicta quia inventore nostrum ab error mollitia?</p>
            <div className="d-flex align-items-center gap-4 mt-3">
                <img src={ava01} alt="" />
                <div>
                    <h5 className='mb-0 mt-'></h5>
                </div>
            </div>
        </div>
          
    </Slider>
  )
}

export default Testimonial
